//fake debt data

const jsonResponse = {
  data: {
    forms: [
      {
        id: 1,
        name: "test 1",
        dateAdded: "4/25/2019",
        initialTotal: "10,000",
        runningTotal: "9,500"
      },
      {
        id: 2,
        name: "test 2",
        dateAdded: "4/25/2019",
        initialTotal: "12,000",
        runningTotal: "8,500"
      }
    ]
  }
};

export default jsonResponse;
